import Box from '@mui/material/Box';
import List from '@mui/material/List';
import ListItem from '@mui/material/ListItem';
import ListItemButton from '@mui/material/ListItemButton';
import ListItemText from '@mui/material/ListItemText';
import ListSubheader from '@mui/material/ListSubheader';
import { Drawer } from '@mui/material';


function StackedNavbar(props) {
  const offWhite = getComputedStyle(document.body).getPropertyValue('--off-white');
  const drawerWidth = 240;
  const items = props.items.split(', ');

  const createListItem = (item) => {
    // return(<Nav.Link key={item} style={{textAlign: 'left', color: 'white'}}>{item}</Nav.Link>);
    // return(<p>test</p>);
    return(
      <ListItem key={text} disablePadding>
        <ListItemButton>
          <ListItemText primary={text}/>
        </ListItemButton>
      </ListItem>
    );
  }

  return (
    <div className='stackedNavbar'>
      {/* <Nav defaultActiveKey="/home" className="flex-column" style={{margin: '20px 20px 20px 20px'}}>
        <Nav.Item style={{textAlign: 'left'}}> Projects
        {items.map((item) => createNavLink(item))}
        </Nav.Item>
      </Nav> */}
      <Box
        sx={{ width: 150}}
        role="presentation"
      >
        <List
          component="nav"
          aria-labelledby="nested-list-subheader"
          subheader={
            <ListSubheader sx={{background: 'rgba(0, 0, 0, 0)', color: offWhite, textAlign: 'left'}} component="div" id="nested-list-subheader">
              Projects
            </ListSubheader>
          }
        >
          {items.map((text) => createListItem(text))}
        </List>
      </Box>
    </div>
  );
}

export default StackedNavbar;
